Author : Joseph Annamkutty Jose
Page : 311
Price : 350

Joseph Annamkutty Jose എന്ന മോട്ടിവേഷനൽ സ്പീക്കറുടെ നാലുവർഷത്തെ അധ്വാനത്തിന് ശേഷം പുറത്തിറങ്ങിയ ആദ്യത്തെ പുസ്തകമാണ് Buried Thoughts. ഗ്രന്ഥകാരന്റെ രണ്ടാമത്തെ പുസ്തകമായ "ദൈവത്തിന്റെ ചാരന്മാർ" ആണ് എനിക്ക് ആദ്യം വായിക്കാൻ അവസരം ലഭിച്ചത്.

പുസ്തകത്തിലൂടെ അവർ തൻ്റെ ജീവിതം ഒരിക്കൽ കൂടെ ഓരോ വായനക്കാരനു മുമ്പിലും ജീവിച്ചു കാണിക്കുകയാണ്. 

പരമ്പരാഗതമായ ആത്മകഥ, ജീവചരിത്ര ഗ്രന്ഥരചനാ ശൈലിയിൽനിന്ന് വളരെ വ്യത്യസ്തമായിട്ടാണ് "Buried Thoughts" എഴുതിയിരിക്കുന്നത്. സാധാരണക്കാരനോട് സംവദിക്കുന്ന ഒരു ജീവിതപുസ്തകം. സ്നേഹം, ഓർമ്മകൾ, പിഴവുകൾ, പ്രതീക്ഷ എന്നീ നാലു ഭാഗങ്ങളിലായി ഇരുപത്തഞ്ചോളം അധ്യായങ്ങളിലായിട്ടാണ് പുസ്തകം രചിക്കപ്പെട്ടിട്ടുള്ളത്.

ജീവിതത്തിന്റെ വ്യത്യസ്ത ഘട്ടങ്ങളിൽ തന്റെ ജീവിതത്തെ സ്‌നേഹംകൊണ്ട് നിറച്ച ഒത്തിരി പേരെയാണ് ആദ്യത്തെ ആറു അധ്യായങ്ങളിലായി പരിചയപ്പെടുത്തിയിരിക്കുന്നത്. കുഞ്ഞായിരുന്നപ്പോൾ അമ്മയേക്കാൾ തനിക്കൊപ്പം ഉണ്ടായിരുന്ന, വീടിനുചുറ്റുമുള്ള മറ്റു കുട്ടികൾ പാവകളുമായി കളിക്കുമ്പോൾ തന്നോടൊത്ത് ജീവിച്ച മരിയുചേച്ചി. സെമിനാരിയിലെ നിയമങ്ങൾക്കിടയിൽ ജീവിതം സ്വാതന്ത്ര്യമില്ലാതായിരിക്കുന്നു എന്ന് തോന്നിയപ്പോൾ തിരികെ പോരുകയാണെന്ന് പറഞ്ഞ നേരത്ത്‌ കൂടെ നിന്ന ഏട്ടൻ. ഒരു മാലാഖയെപ്പോലെ ജീവിതത്തിലേക്ക് കടന്നുവന്ന, ജോപ്പനെ കുറേകൂടി നല്ല മനുഷ്യനാക്കിയ, ജീവിതത്തിലെ ആദ്യത്തെ പ്രണയിനി കാർല. ഒരിക്കൽ ഭക്ഷണം ഉണ്ടാക്കി അമ്മയ്ക്ക് സർപ്രൈസ് കൊടുക്കാനൊരുങ്ങി അബദ്ധത്തിൽ അടുക്കളയിൽ കാല് തുടക്കാനിട്ട തുണികൊണ്ട് തുടച്ച പ്ലേറ്റിൽ ചോറ് വിളമ്പിയ അപ്പച്ചൻ. അതേ അപ്പച്ചൻ തന്നെ, അമ്മ ഏട്ടന്റെ കൂടെ ബാംഗ്ലൂരിലായിരുന്ന സമയത്ത് ഒരാഴ്ച്ച ജോപ്പനെ ഊട്ടി. നല്ല രുചിയുള്ള ഭക്ഷണങ്ങളോടൊപ്പം സ്നേഹവും വിളമ്പിക്കൊടുത്ത് വെറൈറ്റി അനുഭവം ഉണ്ടാക്കിക്കൊടുത്ത അപ്പച്ചൻ. ഇവരൊക്കെയാണ് സ്നേഹത്തിന്റെ പാരമ്യതയിലൂടെ ജോപ്പനെ കൈപിടിച്ചു വഴി നടത്തിയവർ.

ആയിരം പേർ നൽകുന്ന ഉപദേശങ്ങളെക്കാൾ ഫലം ചെയ്യുക ചിലപ്പോൾ ഒരാൾ നൽകുന്ന അനുഭവമായിരിക്കും എന്നൊരു ചൊല്ലുണ്ട്‌. അത് യാഥാർത്യമാക്കുന്നതായിരുന്നു ഈയൊരു വായനാനുഭവം. നല്ല അനുഭവങ്ങളുണ്ടാവാൻ കുറേ ദൂരം യാത്ര ചെയ്യുകയോ ഒരു പാട് പേരെ അറിയുകയോ വേണ്ട. നമ്മൾ ജീവിക്കുന്ന ചുറ്റുപാടിനെ കാണാനും കേൾക്കാനും മൂന്നാമതൊരു കണ്ണും ചെവിയും അനുഭവങ്ങളെ സ്വീകരിക്കാൻ മറ്റൊരു ഹൃദയവും കൂടെ ഉണ്ടായാൽ മതി എന്ന് ഓരോ അധ്യായത്തിലൂടെയും വായനക്കാരനോട് വിളിച്ചു പറയുന്ന ............";}i:30;a:1:{s:14:"comments_count";i:0;}i:31;a:1:{s:11:"likes_count";i:0;}i:32;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEvYVUrpbe1";}i:33;a:1:{s:5:"image";s:237:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/118826940_610572879531441_934264378133871786_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=109&_nc_ohc=3sLEFZs-xQ4AX_dZb8d&oh=6266ee035bfe92868536252f2a59de97&oe=5F7E05FE";}i:34;a:1:{s:4:"type";s:5:"image";}i:35;a:1:{s:8:"owner_id";i:12412493256;}i:36;a:1:{s:14:"owner_username";s:0:"";}i:37;a:1:{s:14:"owner_fullname";s:0:"";}i:38;a:1:{s:9:"owner_pic";s:0:"";}i:39;a:1:{s:2:"id";s:19:"2391234766771926041";}i:40;a:1:{s:10:"short_code";s:11:"CEvX1ngATQZ";}i:41;a:1:{s:12:"created_time";i:1599277419;}i:42;a:1:{s:7:"caption";s:878:"#bar#🥂﻿
